import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import { NicknameInputField } from './InputField';
import ProfileImgPicker from "./ProfileImgPicker";
import * as Buttons from "./Buttons";
import ToastMessage from "./ToastMessage";
import Modal from '../components/Modal';
import useUserData from '../hooks/useUserData';

const ProfileEditForm = () => {
    const [successLabel, setSuccessLabel] = useState('');
    const [errorLabel, setErrorLabel] = useState('');
    const { userId } = useParams();
    const {
        nickname,
        email,
        // showToast,
        setNickname,
        updateNickname
    } = useUserData(userId);

    const [isModalVisible, setIsModalVisible] = useState(false);

    const handleNicknameChange = (e) => {
        setNickname(e.target.value);
    };

    const handleImageUrlChange = (newImageUrl) => {
        if (newImageUrl) {
            console.log('New Image URL:', newImageUrl);
        } else {
            console.error("Received undefined image URL");
        }
    };

    const clearLabels = () => {
        setSuccessLabel('');
        setErrorLabel('');
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        if (!nickname) {
            setErrorLabel('ü•ë ÎãâÎÑ§ÏûÑÏùÑ ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.');
            return;
        }

        try {
            await updateNickname(nickname);
            setSuccessLabel('ü•ë ÎãâÎÑ§ÏûÑ ÏàòÏ†ïÏù¥ ÏôÑÎ£åÎêòÏóàÏäµÎãàÎã§.');
            // setTimeout(() => {
            //     window.location.reload();
            // }, 2000);
        } catch (error) {
            setErrorLabel(`Error: ${error.message}`);
        }
    };

    const showModal = () => {
        setIsModalVisible(true);
        document.body.style.overflow = 'hidden';
    };

    const closeModal = () => {
        setIsModalVisible(false);
        document.body.style.overflow = 'auto';
    };

    const handleAccountDelete = async () => {
        try {
            const response = await fetch(`http://localhost:3001/api/accounts/${userId}`, {
                method: 'DELETE',
                credentials: 'include'
            });
            if (response.ok) {
                alert('Í≥ÑÏ†ïÏù¥ ÏÇ≠Ï†úÎêòÏóàÏäµÎãàÎã§ (“Ç Íí¶‡∫¥„ÉÆÍí¶‡∫¥)');
                console.log('User and associated posts deleted successfully');
                window.location.href = '/login';
            } else {
                const errorMessage = await response.text();
                throw new Error(errorMessage);
            }
        } catch (error) {
            console.error('Error deleting account:', error);
            setErrorLabel(`Error: ${error.message}`);
        }
    };


    return (
        <form className="ProfileEditGroup-Img" onSubmit={handleSubmit}>
            <div className="ProfileEditGroup">
                <div className="ProfileEditFormLabel" style={{ marginTop: '20px' }}>ÌîÑÎ°úÌïÑ ÏÇ¨ÏßÑ*</div>
                <ProfileImgPicker userId={userId} onImageUrlChange={handleImageUrlChange} />
            </div>
            <div className="ProfileEditGroup">
                <div className="ProfileEditFormLabel" style={{ marginTop: '36px' }}>Ïù¥Î©îÏùº</div>
                <p>{email}</p>
            </div>
            <div className="ProfileEditFormLabel">ÎãâÎÑ§ÏûÑ</div>
            <NicknameInputField
                value={nickname}
                onChange={handleNicknameChange}
                placeholder="ÎãâÎÑ§ÏûÑÏùÑ ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî"
            />
            <div className="ProfileSubmitBtn">
                <Buttons.SubmitBtn
                    label={"ÏàòÏ†ïÌïòÍ∏∞"}
                    type="submit"
                />
            </div>
            <div className="Text14" onClick={showModal}
                 style={{ marginTop: '12px', display: 'block', textAlign: 'center', cursor: 'pointer', fontWeight: '500' }}>ÌöåÏõê ÌÉàÌá¥
            </div>
            {/*{showToast && (*/}
            {/*    <div className="ToastMessageContainer">*/}
            {/*        <ToastMessage successLabel={successLabel} errorLabel={errorLabel} clearLabels={clearLabels} />*/}
            {/*    </div>*/}
            {/*)}*/}
            <Modal
                isVisible={isModalVisible}
                ModalLabel="ÌöåÏõêÌÉàÌá¥ ÌïòÏãúÍ≤†ÏäµÎãàÍπå?"
                ModalContent="ÏûëÏÑ±Îêú Í≤åÏãúÍ∏ÄÍ≥º ÎåìÍ∏ÄÏùÄ ÏÇ≠Ï†úÎê©ÎãàÎã§."
                onClose={closeModal}
                onConfirm={handleAccountDelete}
            />
            <ToastMessage successLabel={successLabel} errorLabel={errorLabel} clearLabels={clearLabels} />
        </form>
    );
};

export default ProfileEditForm;
